import logo from './logo.svg';
import './App.css';
import React from "react";


function App() {
  const [data, setData] = React.useState(null);
  React.useEffect(() => {
    fetch("/api/hello")
    .then((res) => res.json())
    .then((data) => setData(data.message));
   }, []);
  return (
    <><nav>
      <div>
        <a href='/'>Tabla de Imaginantes</a>
      </div>
    </nav></>
  );
}

export default App;
